Opportunity_Owner_2.query:
q = load "${App.Datasets.SalesRep_AccountsLeadsScored_Pipeline_tp.FullyQualifiedName}";
q = group q by 'Opportunity_Owner';
q = foreach q generate 'Opportunity_Owner' as 'Opportunity_Owner', count() as 'count';
q = order q by 'Opportunity_Owner' asc;
q = limit q 2000;

What_Does_Einstein_T_1.query:
q = load "${App.Datasets.SalesRep_AccountsLeadsScored_Pipeline_tp.FullyQualifiedName}";
q = filter q by (!('Opportunity_Stage' in ["5 - Closed Won", "6 - Closed Lost"]) || 'Opportunity_Stage' is null);
q = group q by ('Opportunity_Stage', 'Lead_Score_bucket');
q = foreach q generate 'Opportunity_Stage' as 'Opportunity_Stage', 'Lead_Score_bucket' as 'Lead_Score_bucket', sum('Opportunity_Amount')/1.046875 as 'sum_Opportunity_Amount';
q = order q by ('Opportunity_Stage' asc, 'Lead_Score_bucket' asc);
q = limit q 2000;

Quota_Attainment_4.query:
q = load "${App.Datasets.SalesRep_AccountsLeadsScored_Pipeline_tp.FullyQualifiedName}";
q_A = filter q by 'Opportunity_Stage' == "5 - Closed Won";
result = group q_A by all;
result = foreach result generate sum(q_A.'Opportunity_Amount') as 'A';
result = foreach result generate 'A', A/1.046875/1250000 as 'Quota_Attainment';
result = limit result 2000;

