Pipeline_Over_Time_1.query:
q = load "${App.Datasets.SalesRep_AccountsLeadsScored_Pipeline_tp.FullyQualifiedName}";
q = filter q by !('Opportunity_Stage' matches "6 - Closed Lost");
q = filter q by !('Forecast_Category' matches "Omitted");
q = group q by ('Close_Date_Year', 'Close_Date_Week');
q = foreach q generate 'Close_Date_Year' + "~~~" + 'Close_Date_Week' as 'Close_Date_Year~~~Close_Date_Week', sum(sum('Opportunity_Amount')) over([.. 0] partition by all order by ('Close_Date_Year', 'Close_Date_Week'))/1.046875 as 'sum_Opportunity_Amount';

q = order q by 'Close_Date_Year~~~Close_Date_Week' asc;
q = limit q 2000;

